We could just look at the descriptions and appearances of the various emoticons and cluster them into broad categories based on that. However, instead we will try to use our collected tweet dataset to create a clustering. Then we will use the intuition based on the descriptions and appearances to judge how successful this approach was. We will use the Jaccard distance between emoticons to try to cluster them. The Jaccard distance between emoticons \(e_1\) and \(e_2\) is given by \[ d(e_1, e_2) = 1 - \frac{\# (e_1\wedge e_2)}{\# (e_1) + \# (e_2) - \# (e_1\wedge e_2)}, \] where \(\#(e)\) is the number of tweets collected containing the emoticon \(e\), and \(\# (e_1\wedge e_2)\) is the number of tweets collected containing both \(e_1\) and \(e_2\). In order to find the Jaccard distances between emoticons, we must create a matrix containing for each pair of emoticons how often they appear together in the dataset of tweets and also in how many tweets each emoticon appears individually. First we define a function to create such a matrix for an individual tweet. Then we will sum these matrices for all the tweets. The matrices will be represented by a 1D array following a certain indexing scheme and containing the entries of the upper triangular part of the matrix (there would be redundancy in finding the whole matrix since it will be symmetric). def emoticonPairToIndex (a : Int, b : Int) : Int = { // helper function for indexing val i = if (a < b) a else b // makes sure j >= i val j = if (a < b) b else a return i*nbrEmoticons - (i * (i+1))/2 + j } def createEmoticonIterator (s : String) : scala.util.matching.Regex.MatchIterator = { // helper function for iterating through the emoticons in a string s return s"""[${emoticonsList.mkString}]""".r.findAllIn(s)
} def createEmoticonMatrix (s : String) : Array[Int] = { // The pair (i, j) will be at location i*(nbrEmoticons - (i+1)/2) + j in this array (this is compatible with later scipy functions) var m = Array.fill((nbrEmoticons*nbrEmoticons + nbrEmoticons)/2)(0) // there are 80 emoticons and thus 80^2 / 2 + 80 / 2 emoticon pairs including pairs of the same emoticon val emoticonIterator = createEmoticonIterator(s) // sets m to 1 for each index corresponding to a pair of emoticons present in the string s (very hacky code...) emoticonIterator.zipWithIndex.foreach(em_pair => // iterate over emoticons in s (createEmoticonIterator(s).drop(em_pair._2)).foreach( // iterate over remaining emoticons in s second_em => (m(emoticonPairToIndex( emoticonsMap(em_pair._1), emoticonsMap(second_em)) ) = 1) // set m to 1 for each emoticon pair found in s ) ) return m
} emoticonPairToIndex: (a: Int, b: Int)Int
createEmoticonIterator: (s: String)util.matching.Regex.MatchIterator
createEmoticonMatrix: (s: String)Array[Int] In the cell below we sum all the "occurence-matrices" and print the diagonal of the summed matrix, i.e. the number of tweets containing each individual emoticon. It is clear that some emoticons are used far more often than others. val emoticonsMatrix = fullDF.select("CurrentTweet") .filter($"CurrentTweet".rlike(emoticonsList.mkString("|"))) // filters tweets with emoticons .map(row => createEmoticonMatrix(row.mkString)) // creates an "adjacency matrix" for each tweet .reduce((_, _).zipped.map(_ + _)) // sums the matrices elementwise emoticonsList.zipWithIndex.foreach({case (e, i) => println(e + ", " + Integer.toString(emoticonsMatrix(emoticonPairToIndex(i, i))) + " occurences")}) In the following two cells we create the Jaccard distance matrix which we want to use to cluster the emoticons. def jaccardDistance (e1 : Int, e2 : Int) : Double = { // specify the emojis in terms of their indices in the list return 1.0 - 1.0 * emoticonsMatrix(emoticonPairToIndex(e1, e2)) / (emoticonsMatrix(emoticonPairToIndex(e1, e1)) + emoticonsMatrix(emoticonPairToIndex(e2, e2)) - emoticonsMatrix(emoticonPairToIndex(e1, e2)))
} jaccardDistance: (e1: Int, e2: Int)Double var jaccardMatrix = Array.fill(emoticonsMatrix.length)(1.0)
(0 until nbrEmoticons).foreach(i => (i until nbrEmoticons).foreach(j => (jaccardMatrix(emoticonPairToIndex(i, j)) = jaccardDistance(i, j)))) Finally we write the Jaccard distance matrix and the emoticon list to file so that we don't have to keep rerunning the above cells and so that we can load them into python cells next. //scala.tools.nsc.io.File("/dbfs/datasets/ScaDaMaLe/twitter/student-project-10_group-Geosmus/emoticonsList.txt").writeAll(emoticonsList.mkString("\n"))
